import React from 'react'
import { NavigationItem } from 'react';

export const Navigation = (props) => {
    return (
        <div className="navigation">
            <nav>
                <ul className="Menu">
                    <NavigationItem text="Dashboard" />
                </ul>
            </nav>
        </div>
    )
}
